const navbar = () => {
  return (
    <>
      <nav className="flex flex-row space-x-240 items-center justify-center bg-principal-color h-24 w-full">
        <p className="text-white text-2xl">ProVision</p>

        <div className="text-white space-x-10">
          <a href="#" className="text-white">Home</a>
          <a href="#" className="text-white">About us</a>
          <a href="#" className="text-white">Features</a>
          <a href="#" className="text-white">Contact us</a>
        </div>

      </nav>
      
      
      
    </>
  );
};

export default navbar;
